import api from './api';

class GuruService {
  getAll() {
    return api.get('/test/listguru');
  }
  get(id) {
    return api.get(`/test/listguru/${id}`);
  }
  create(data) {
    return http.post("/test/listguru", data);
  }
  update(id, data) {
    return api.patch(`/test/listguru/${id}`,data);
  }
  delete(id) {
    return api.delete(`/test/listguru/${id}`);
  }
}

export default new GuruService();
